} from "mdb-react-ui-kit";

function PreviousBookings() {
  const location = useLocation();
  const name = location.state.name;
  const mail = location.state.mail;
  const localhost = process.env.LOCALHOST2;
  const backend = process.env.backend2;
  const today = moment().format("YYYY-MM-DDTHH:mm:ss.SSS[Z]");
  const [review, setreview] = useState("Review: ");
  const [users, setUsers] = useState([]);
  const [centredModal, setCentredModal] = useState({ id: "", open: false });
  const [centredModal1, setCentredModal1] = useState({ id: "", open: false });
  const [text, settext] = useState("If yes, Payment is processed in 24 hours");

  useEffect(() => {
    axios
      .get(`${localhost}`, {
        params: {
          name: name,
          mail: mail,
        },
      })
      .then((response) => {
        const data = response.data.response;
        if (Array.isArray(data)) {
          setUsers(data);
        } else {
          /* eslint-disable */console.error(...oo_tx(`905456797_44_10_44_62_11`,"Data fetched is not an array:", data));
        }
      })
      .catch((err) => /* eslint-disable */console.log(...oo_oo(`905456797_47_22_47_38_4`,err)));
  }, [users]);

  const handleUpdate = async (movieId, review) => {
    try {
      const response = await fetch(
        `${localhost}/${movieId}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({ movieId, review }), // Ensure review is an object
        }
      );

      if (response.ok) {
        setreview("Review Submitted Successfully ðŸŽ‰ðŸŽ‰");
        setTimeout(() => {
          setreview("Review: ");
          setCentredModal((prevState) => ({
            ...prevState,
            open: 0,
            id: "",
          }));
        }, 2000);
      }
    } catch (err) {
      /* eslint-disable */console.error(...oo_tx(`905456797_75_6_75_49_11`,"Error updating movie:", err));
    }
  };

  const handleDelete = async (movieId) => {
    try {
      const response = await fetch(`${localhost}/${movieId}`, {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
        },
      });
      if (response.ok) {
        setUsers((prevItems) => prevItems.filter((_, i) => i !== movieId));
        settext(
          "Ticket is Successfully Cancelled ðŸŽ‰ðŸŽ‰, Payment will be processed in 24 hours"
        );
        setTimeout(() => {
          setCentredModal1((prevState) => ({
            ...prevState,
            open: 0,
            id: "",
          }));
          settext("If yes, Payment is processed in 24 hours");
        }, 2000);
      } else {
        /* eslint-disable */console.log(...oo_oo(`905456797_101_8_101_45_4`,"Failed to delete movie"));
      }
    } catch (err) {
      /* eslint-disable */console.log(...oo_oo(`905456797_104_6_104_22_4`,err));
    }
  };
  const toggleShow = (event) => {
    const ids = event.target.id;
    setCentredModal((prevState) => ({
      open: !prevState.open,
      id: ids,
    }));
  };

  const toggleShow1 = (event) => {
    const ids = event.target.id;

    setCentredModal1((prevState) => ({
      open: !prevState.open,
      id: ids,
    }));
  };
  function compareDates1(today, dataDate) {
    if (today < dataDate) {
      return 0;
    } else {
      return 1;
    }
  }

  return (
    <>
      <Nav />
      <div className="prevbook">
        {users.length !== 0 && <h3>Previous Bookings</h3>}
        {users.length === 0 && <h3>No Previous Bookings</h3>}
      </div>
      <div>
        <div className="prevtable">
          {users &&
            users.map((data) => (
              <div key={data._id} className="prevbookdata">
                <div className="prevbookdatain">
                  <div>
                    <img
                      className="prevbookdataimg"
                      src={`https://image.tmdb.org/t/p/w300/` + data.photo}
                      alt=""
                    ></img>
                  </div>
                  <div>
                    <td>
                      <table className="prevbookdetails">
                        <div>
                          <h3
                            style={{
                              textTransform: "uppercase",
                              fontWeight: "bolder",
                            }}
                          >
                            <strong>{data.title}</strong>
                          </h3>
                        </div>
                        <div>
                          <td>
                            {data.date.substr(0, 10)} | {data.time}
                          </td>
                        </div>
                        <div>
                          <td>
                            {data.theater} | {data.city}
                          </td>
                        </div>
                        <div>
                          <td>Tickets = {data.count}</td>
                        </div>
                        <div>
                          <td>Cost = {data.cost}</td>
                        </div>
                      </table>
                    </td>
                  </div>
                </div>
                <div className="prevbookitems">
                  <MDBModal
                    tabIndex="-1"
                    show={centredModal1.open}
                    setShow={setCentredModal1.open}
                  >
                    <MDBModalDialog centered size="md">
                      <MDBModalContent>
                        <MDBModalHeader>
                          <MDBModalTitle>
                            ARE YOU SURE YOU WANT TO CANCEL THE TICKET ?
                          </MDBModalTitle>
                        </MDBModalHeader>
                        <MDBModalBody>{text}</MDBModalBody>
                        <MDBModalFooter>
                          <button
                            className="modalyes"
                            onClick={() => handleDelete(centredModal1.id)}
                          >
                            Yes
                          </button>
                          <button
                            className="modalyes"
                            id=""
                            onClick={toggleShow1}
                          >
                            No
                          </button>
                        </MDBModalFooter>
                      </MDBModalContent>
                    </MDBModalDialog>
                  </MDBModal>
                  {compareDates1(today, data.date) === 0 && (
                    <button
                      className="deleteticket"
                      id={data._id}
                      onClick={toggleShow1}
                    >
                      <div>
                        <i
                          className="fa-solid fa-trash "
                          id={data._id}
                          style={{ color: "#f84464" }}
                        ></i>
                      </div>
                    </button>
                  )}
                  <MDBModal
                    tabIndex="-1"
                    show={centredModal.open}
                    setShow={setCentredModal.open}
                  >
                    <MDBModalDialog centered size="md">
                      <MDBModalContent>
                        <MDBModalHeader>
                          <MDBModalTitle>
                            Enter your opinion on the film
                          </MDBModalTitle>
                        </MDBModalHeader>
                        <MDBModalBody>
                          <textarea
                            className="textarea1"
                            rows="6"
                            cols="40"
                            onChange={(e) => setreview(e.target.value)}
                            value={review}
                          ></textarea>
                        </MDBModalBody>
                        <MDBModalFooter>
                          <button
                            className="modalyes"
                            onClick={() =>
                              handleUpdate(centredModal.id, review)
                            }
                          >
                            Submit
                          </button>
                          <button
                            className="modalyes"
                            id=""
                            onClick={toggleShow}
                          >
                            Cancel
                          </button>
                        </MDBModalFooter>
                      </MDBModalContent>
                    </MDBModalDialog>
                  </MDBModal>
                  {compareDates1(today, data.date) === 1 && (
                    <button
                      className="rateticket"
                      id={data._id}
                      onClick={toggleShow}
                    >
                      <div>
                        <i
                          className="fa-solid fa-magnifying-glass"
                          id={data._id}
                          style={{ color: "#f84464" }}
                        ></i>
                      </div>
                      <p id={data._id}>&nbsp; Add Review</p>
                    </button>
                  )}
                </div>
              </div>
            ))}
        </div>
      </div>
    </>
  );
}
export default PreviousBookings;
